INSERT INTO `system_plugin_history` VALUES (1,'October.Demo','comment','1.0.1','First version of Demo','2017-02-06 10:47:19'),(2,'RainLab.Builder','comment','1.0.1','Initialize plugin.','2017-02-06 13:08:50'),(3,'RainLab.Builder','comment','1.0.2','Fixes the problem with selecting a plugin. Minor localization corrections. Configuration files in the list and form behaviors are now autocomplete.','2017-02-06 13:08:50'),(4,'RainLab.Builder','comment','1.0.3','Improved handling of the enum data type.','2017-02-06 13:08:50'),(5,'RainLab.Builder','comment','1.0.4','Added user permissions to work with the Builder.','2017-02-06 13:08:50'),(6,'RainLab.Builder','comment','1.0.5','Fixed permissions registration.','2017-02-06 13:08:50'),(7,'RainLab.Builder','comment','1.0.6','Fixed front-end record ordering in the Record List component.','2017-02-06 13:08:50'),(8,'RainLab.Builder','comment','1.0.7','Builder settings are now protected with user permissions. The database table column list is scrollable now. Minor code cleanup.','2017-02-06 13:08:50'),(9,'RainLab.Builder','comment','1.0.8','Added the Reorder Controller behavior.','2017-02-06 13:08:50'),(10,'RainLab.Builder','comment','1.0.9','Minor API and UI updates.','2017-02-06 13:08:50'),(11,'RainLab.Builder','comment','1.0.10','Minor styling update.','2017-02-06 13:08:50'),(12,'RainLab.Builder','comment','1.0.11','Fixed a bug where clicking placeholder in a repeater would open Inspector. Fixed a problem with saving forms with repeaters in tabs. Minor style fix.','2017-02-06 13:08:50'),(13,'RainLab.Builder','comment','1.0.12','Added support for the Trigger property to the Media Finder widget configuration. Names of form fields and list columns definition files can now contain underscores.','2017-02-06 13:08:50'),(14,'RainLab.Builder','comment','1.0.13','Minor styling fix on the database editor.','2017-02-06 13:08:50'),(15,'RainLab.Builder','comment','1.0.14','Added support for published_at timestamp field','2017-02-06 13:08:50'),(16,'RainLab.Builder','comment','1.0.15','Fixed a bug where saving a localization string in Inspector could cause a JavaScript error. Added support for Timestamps and Soft Deleting for new models.','2017-02-06 13:08:50'),(17,'RainLab.Builder','comment','1.0.16','Fixed a bug when saving a form with the Repeater widget in a tab could create invalid fields in the form\'s outside area. Added a check that prevents creating localization strings inside other existing strings.','2017-02-06 13:08:50'),(18,'RainLab.Builder','comment','1.0.17','Added support Trigger attribute support for RecordFinder and Repeater form widgets.','2017-02-06 13:08:50'),(19,'RainLab.Builder','comment','1.0.18','Fixes a bug where \'::class\' notations in a model class definition could prevent the model from appearing in the Builder model list. Added emptyOption property support to the dropdown form control.','2017-02-06 13:08:50'),(20,'RainLab.Builder','comment','1.0.19','Added a feature allowing to add all database columns to a list definition. Added max length validation for database table and column names.','2017-02-06 13:08:50'),(21,'RainLab.Builder','comment','1.0.20','Fixes a bug where form the builder could trigger the \"current.hasAttribute is not a function\" error.','2017-02-06 13:08:50'),(67,'Vage.Calculator','comment','1.0.1','Initialize plugin.','2017-02-06 14:48:48'),(68,'Vage.Calculator','script','1.0.3','builder_table_create_vage_calculator_month.php','2017-02-06 14:48:48'),(69,'Vage.Calculator','comment','1.0.3','Created table vage_calculator_month','2017-02-06 14:48:48'),(70,'Vage.Calculator','script','1.0.7','builder_table_update_vage_calculator_month.php','2017-02-06 14:48:48'),(71,'Vage.Calculator','comment','1.0.7','Updated table vage_calculator_month','2017-02-06 14:48:48'),(72,'Vage.Calculator','script','1.0.8','builder_table_delete_vage_calculator_month.php','2017-02-06 14:48:48'),(73,'Vage.Calculator','comment','1.0.8','Drop table vage_calculator_month','2017-02-06 14: